import React from 'react';
import { Line, Doughnut } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
} from 'chart.js';
import './Dashboard.css';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement
);

const Dashboard = () => {
  const salesData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Sales',
        data: [30, 45, 35, 50, 40, 60],
        borderColor: '#2563eb',
        tension: 0.4,
      },
    ],
  };

  const categoryData = {
    labels: ['Electronics', 'Fashion', 'Food', 'Books'],
    datasets: [
      {
        data: [35, 25, 20, 20],
        backgroundColor: ['#2563eb', '#3b82f6', '#60a5fa', '#93c5fd'],
      },
    ],
  };

  const recentOrders = [
    { id: '#1234', customer: 'John Doe', product: 'iPhone 13', status: 'completed', amount: '$999' },
    { id: '#1235', customer: 'Jane Smith', product: 'MacBook Pro', status: 'pending', amount: '$1299' },
    { id: '#1236', customer: 'Bob Johnson', product: 'AirPods Pro', status: 'processing', amount: '$249' },
  ];

  return (
    <div className="dashboard">
      <h1 className="dashboard-title">Dashboard</h1>

      <div className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">
            <i className="fas fa-shopping-cart"></i>
          </div>
          <div className="stat-details">
            <h3>Total Orders</h3>
            <p className="stat-value">1,234</p>
            <p className="stat-change positive">+15.3% from last month</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">
            <i className="fas fa-dollar-sign"></i>
          </div>
          <div className="stat-details">
            <h3>Revenue</h3>
            <p className="stat-value">$45,678</p>
            <p className="stat-change positive">+12.5% from last month</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">
            <i className="fas fa-users"></i>
          </div>
          <div className="stat-details">
            <h3>Customers</h3>
            <p className="stat-value">892</p>
            <p className="stat-change positive">+8.2% from last month</p>
          </div>
        </div>

        <div className="stat-card">
          <div className="stat-icon">
            <i className="fas fa-box"></i>
          </div>
          <div className="stat-details">
            <h3>Products</h3>
            <p className="stat-value">156</p>
            <p className="stat-change positive">+5.7% from last month</p>
          </div>
        </div>
      </div>

      <div className="charts-grid">
        <div className="chart-card">
          <h3>Sales Overview</h3>
          <Line 
            data={salesData}
            options={{
              responsive: true,
              plugins: {
                legend: {
                  position: 'top',
                },
              },
              scales: {
                y: {
                  beginAtZero: true,
                },
              },
            }}
          />
        </div>

        <div className="chart-card">
          <h3>Sales by Category</h3>
          <Doughnut 
            data={categoryData}
            options={{
              responsive: true,
              plugins: {
                legend: {
                  position: 'right',
                },
              },
            }}
          />
        </div>
      </div>

      <div className="recent-orders">
        <h3>Recent Orders</h3>
        <div className="table-container">
          <table>
            <thead>
              <tr>
                <th>Order ID</th>
                <th>Customer</th>
                <th>Product</th>
                <th>Status</th>
                <th>Amount</th>
              </tr>
            </thead>
            <tbody>
              {recentOrders.map((order) => (
                <tr key={order.id}>
                  <td>{order.id}</td>
                  <td>{order.customer}</td>
                  <td>{order.product}</td>
                  <td>
                    <span className={`status-badge ${order.status}`}>
                      {order.status}
                    </span>
                  </td>
                  <td>{order.amount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
